	@Inject
	public AleGrammarAccess(GrammarProvider grammarProvider,
			XbaseGrammarAccess gaXbase,
			XtypeGrammarAccess gaXtype) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaXbase = gaXbase;
		this.gaXtype = gaXtype;
		this.pAleRoot = new AleRootElements();
		this.pEcoreImport = new EcoreImportElements();
		this.pAleImport = new AleImportElements();
		this.pAleClass = new AleClassElements();
		this.pAleMethod = new AleMethodElements();
		this.pConcreteMethod = new ConcreteMethodElements();
		this.pAbstractMethod = new AbstractMethodElements();
		this.pDefMethod = new DefMethodElements();
		this.pOverrideMethod = new OverrideMethodElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("ale.xtext.Ale".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
